                                                                                        my $rseqid = 0;
                                                                                        my $fname  = undef;
                                                                                        my $mtype  = 0;

                                                                                        $input->readMessageBegin(\$fname, \$mtype, \$rseqid);
                                                                                        my $methodname = 'process_'.$fname;
                                                                                        if (!$self->can($methodname)) {
                                                                                          $input->skip(TType::STRUCT);
                                                                                          $input->readMessageEnd();
                                                                                          my $x = new TApplicationException('Function '.$fname.' not implemented.', TApplicationException::UNKNOWN_METHOD);
                                                                                          $output->writeMessageBegin($fname, TMessageType::EXCEPTION, $rseqid);
                                                                                          $x->write($output);
                                                                                          $output->writeMessageEnd();
                                                                                          $output->getTransport()->flush();
                                                                                          return;
                                                                                        }
                                                                                        $self->$methodname($rseqid, $input, $output);
                                                                                        return 1;
}

sub process_getPartOfSpeechTag {
                                                                                        my ($self, $seqid, $input, $output) = @_;
                                                                                        my $args = new thrift::adept::common::PartOfSpeechService_getPartOfSpeechTag_args();
                                                                                        $args->read($input);
                                                                                        $input->readMessageEnd();
                                                                                        my $result = new thrift::adept::common::PartOfSpeechService_getPartOfSpeechTag_result();
                                                                                        $result->{success} = $self->{handler}->getPartOfSpeechTag();
                                                                                        $output->writeMessageBegin('getPartOfSpeechTag', TMessageType::REPLY, $seqid);
                                                                                        $result->write($output);
                                                                                        $output->writeMessageEnd();
                                                                                        $output->getTransport()->flush();
}

